"   </div>",
"   <div class=\"cntnt\" style=\"width: 444px; height: 202px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dobutamine stress CMR studies in a patient with three vessel disease and a prior anterior wall myocardial infarction.",
"    <br>",
"     (Left upper panel) At rest, the short axis CMR during diastole shows that the diastolic wall thickness (DWT) of the anteroseptal wall is significantly reduced (arrows).",
"     <br>",
"      (Left lower panel) The entire region shows a lack of systolic wall thickening (SWT).",
"      <br>",
"       (Middle lower panel) During a dobutamine infusion, there was no measurable increase in SWT of the anteroseptal wall, indicating scar tissue.",
"       <br>",
"        (Right upper and lower panel) Six months after successful bypass surgery (CABG), the reduction in DWT persisted (arrows, upper panel) there was no improvement in SWT.",
"        <div class=\"footnotes\">",
"        </div>",
